import React from "react";
import Header from "./Header";
import Footer from "./Footer";

const layoutStyle = {
  margin: 0,
  background: "yellow",
  fontFamily: "YuMincho",
  letterSpacing: 1,
};

const Layout = (props) => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
    <Footer />
  </div>
);

export default Layout;
